   On 02 Feb 2021, patient believed the vaccine was given too high on her shoulder, and had nausea, fatigue and pain at the injection site (shoulder and arm) which increased with movements, radiating to the upper limb and had trouble sleeping, treated with Tylenol.
   Action taken with mRNA-1273 in response to the events was unknown.
